import React, {Component } from 'react'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isLoaded: false,
    }
  }

  componentDidMount() {
    fetch('https://01vablvh7h.execute-api.us-east-1.amazonaws.com/dev/getallregistereduser')
      .then(response => response.json())
      .then(json => {
        this.setState({
          isLoaded: true,
          items: json,
        })
      });
  }


  render() {
    return (
      <div className="App">
      </div>
    );
  }
}

export default App;
